import React from 'react';
import lettuceImg from '../../../../assets/images/pokeIngredients/lettuceBGfree.png';
import classes from './Lettuce.module.css';
const lettuce=()=>(
<div className={classes.Lettuce}>
    <img src={lettuceImg} alt="Lettuce"/>
</div>
);

export default lettuce;
